import React, { useState, useEffect, useRef, useCallback } from "react";
import {Navigate } from "react-router";
import {
  FormGroup,
  FormControl,
  InputLabel,
  TextField,
  MenuItem,
  Select,
  Typography,
  Button,
} from "@material-ui/core";
import { socket } from "../modules";
import axios from "axios";

function Create({ user, setUser }) {
  const [roomID, setRoomID] = useState("");

  const [status, setStatus] = useState("SEND");
  const timerRef = useRef(null);
  const [submitted, setSubmitted] = useState(false);

  // Game creation form state
  const [state, setState] = useState({
    username: "",
    lives: "6",
    numRounds: "3",
    rotation: "king",
    time: "30",
  });

  // Feedback form state
  const [form, setForm] = useState({
    name: "",
    email: "",
    feedback: "",
  });

  const handleLink = useCallback((info) => {
    setUser(info.gameState.players[0]);
    setRoomID(info.roomID);
  }, [setUser]);

  const validateUsername = () => {
    const username = document.getElementById("username");
    if (!/^[^\s]+(\s+[^\s]+)*$/.test(username.value)) {
      username.setCustomValidity("Username cannot have leading or trailing spaces");
    } else if (username.value.length > 20) {
      username.setCustomValidity("Username must be between 1 and 20 characters");
    } else {
      username.setCustomValidity("");
    }
  };

  useEffect(() => {
    socket.on("link", handleLink);
    return () => socket.off("link", handleLink);
  }, [handleLink]);

  const handleSubmit = (e) => {
    e.preventDefault();
    setSubmitted(true);
    setState({ ...state, username: "" });
    socket.emit("create", state);
  };

  const handleForm = async (e) => {
    e.preventDefault();
    if (timerRef.current) clearTimeout(timerRef.current);

    setStatus("Sent!");
    await axios.post(`${process.env.REACT_APP_SERVER}/feedback/`, {
      data: form,
    });

    setForm({ name: "", email: "", feedback: "" });

    timerRef.current = setTimeout(() => setStatus("Send"), 5000);
  };

  return (
    <>
      <div className="create-container">
        <div className="info-container">
          <Typography variant="h5">About</Typography>
          hangmanonline.io is a free online platform to play Hangman with your friends.
          <br /><br />

          <Typography variant="h5">How to Play</Typography>
          When it's your turn to be the "hanger", choose a word and category...
          <br /><br />

          <Typography variant="h5">Feedback</Typography>
          We appreciate your feedback!
          <br /><br />

          {/* Feedback Form */}
          <form onSubmit={handleForm} style={{ marginBottom: "25px" }}>
            <InputLabel>Name:</InputLabel>
            <TextField
              type="text"
              value={form.name}
              onChange={(e) => setForm({ ...form, name: e.target.value })}
              id="name"
              name="name"
              disabled={status === "Sent!"}
              required
            />
            <br /><br />

            <InputLabel>Email:</InputLabel>
            <TextField
              type="email"
              value={form.email}
              onChange={(e) => setForm({ ...form, email: e.target.value })}
              id="email"
              name="email"
              disabled={status === "Sent!"}
              required
            />
            <br /><br />

            <InputLabel>Feedback:</InputLabel>
            <TextField
              type="text"
              multiline
              rows={4}
              value={form.feedback}
              onChange={(e) => setForm({ ...form, feedback: e.target.value })}
              id="comment"
              name="comment"
              disabled={status === "Sent!"}
              required
            />
            <br /><br />

            <Button variant="contained" color="primary" type="submit">
              {status}
            </Button>
          </form>
        </div>

        {/* Game Creation Form */}
        <div className="right">
          <form
            onSubmit={handleSubmit}
            style={{ minWidth: "225px", maxWidth: "400px" }}
          >
            <Typography variant="h4">Play</Typography>
            <br />

            <FormGroup>
              <TextField
                type="text"
                value={state.username}
                onChange={(e) => setState({ ...state, username: e.target.value })}
                id="username"
                name="username"
                label="Username"
                onInput={validateUsername}
                variant="filled"
                required
                disabled={submitted}
              />
              <br />

              <TextField
                type="number"
                label="Lives"
                value={state.lives}
                onChange={(e) => setState({ ...state, lives: e.target.value })}
                id="lives"
                name="lives"
                inputProps={{ min: 6, max: 10 }}
                variant="filled"
                required
                disabled={submitted}
              />
              <br />

              <TextField
                type="number"
                label="Rounds"
                value={state.numRounds}
                onChange={(e) => setState({ ...state, numRounds: e.target.value })}
                id="numRounds"
                name="numRounds"
                inputProps={{ min: 1 }}
                variant="filled"
                required
                disabled={submitted}
              />
              <br />

              <FormControl>
                <InputLabel id="rotation-label">Rotation</InputLabel>
                <Select
                  labelId="rotation-label"
                  value={state.rotation}
                  onChange={(e) =>
                    setState({ ...state, rotation: e.target.value })
                  }
                  variant="filled"
                  required
                  disabled={submitted}
                >
                  <MenuItem value="king">King of the Hill</MenuItem>
                  <MenuItem value="robin">Round Robin</MenuItem>
                </Select>
              </FormControl>
              <br />

              <FormControl>
                <InputLabel id="time-label">Guess Time (sec)</InputLabel>
                <Select
                  labelId="time-label"
                  value={state.time}
                  onChange={(e) =>
                    setState({ ...state, time: e.target.value })
                  }
                  variant="filled"
                  required
                  disabled={submitted}
                >
                  {["10", "20", "30", "40", "50", "60", "70", "80", "90", "inf"].map((t) => (
                    <MenuItem key={t} value={t}>{t}</MenuItem>
                  ))}
                </Select>
              </FormControl>
              <br /><br />

              <Button
                variant="contained"
                color="primary"
                type="submit"
                disabled={submitted}
              >
                Create Game
              </Button>
            </FormGroup>
          </form>

          <br />
          <p>Creators: Vikhram Thirupathi, Srihari Srinivasan, Rimaz Khan</p>
        </div>
      </div>

      {user !== "" && roomID !== "" && <Redirect to={`/${roomID}`} />}
    </>
  );
}

export default Create;
